import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const Header = () => {

  return (
    <>

      {/* Header bar */}
      <div className="header">
          <img
            src={ActiveQuestLogo} 
            alt="ActiveQuest logo"
            className="header-logo"
          />


          <div className="icon-button">
            <FontAwesomeIcon icon="user" />
          </div>

        <div className="icon-button">
          &#9881;
        </div>
      </div>
    </>
  );
};

export default Header;
